import React from 'react';
const HomePage = () => {
    return (
        <div className="home-page">
            <h1>Trang Chủ</h1>
            <p>Chức năng này đang được phát triển.</p>
            <p>Vui lòng quay lại sau.</p>
        </div>
    )
}
export default HomePage;
